{-# LANGUAGE FlexibleContexts #-}
{-# LANGUAGE FlexibleInstances #-}
{-# LANGUAGE FunctionalDependencies #-}
{-# LANGUAGE MultiParamTypeClasses #-}
{-# LANGUAGE TypeFamilies #-}
{-# LANGUAGE UndecidableInstances #-}

module Nomo.Acc.Tuple (
    Tuple,
    TupleCase,
    tuple,
    tupleCase,
  ) where

import           Data.Tuple.Solo

import           Nomo.Class

newtype Tuple t = Tuple t

tuple :: (a,b) -> Tuple (a,b)
tuple = Tuple

instance
  (
    x ~ t
  )
  =>
  Stop (Tuple t) x
  where
    stop (Tuple t) = t

instance
  (
    TuplePush old x new
  )
  =>
  Step (Tuple old) x (Tuple new)
  where
    step (Tuple old) x = Tuple (tuplePush old x)

-----

data TupleCase t r = TupleCase

tupleCase :: TupleCase t r
tupleCase = TupleCase

instance
  (
    t ~ ()
  ,
    res ~ (() -> r)
  ,
    a ~ r
  )
  =>
  Costop (TupleCase t r) a res
  where
    costop TupleCase a = \() -> a

instance
  (
    TuplePop outer a inner
  ,
    res ~ (outer -> r)
  ,
    res' ~ (inner -> r)
  )
  =>
  Costep (TupleCase outer r) res a (TupleCase inner r) res'
  where
    costep TupleCase k = \outer -> k TupleCase `uncurry` tuplePop outer

--------------------------------------------------------------------------------
