class
  TuplePush old a new
  | old a -> new, a new -> old
  where
    tuplePush :: old -> a -> new

instance TuplePush () x (Solo x) where tuplePush () x = (Solo x)
instance TuplePush (Solo a1) x (a1,x) where tuplePush (Solo a1) x = (a1,x)
